import NavTray from "./NavTray"
import NewThreadButton from "./NewThreadButton"
import ThreadsTray from "./ThreadsTray"
import NewFreewriteThreadButton from "./NewFreewriteThreadButton"
import FreeWriteThreadsTray from "./FreeWriteThreadsTray"
import ModeSelector from "./ModeSelector"

function Left({
	showNav,
	selectedMode,
	setSelectedMode,
	threads,
	setThreads,
	selectedThread,
	setSelectedThread,
	freewriteThreads,
	setFreewriteThreads,
	selectedFreewriteThread,
	setSelectedFreewriteThread,
	subscribed,
	setShowSettings,
}) {
	return (
		<div
			className={
				showNav
					? "w-15 flex flex-col h-screen justify-start items-center rounded-tr-[30px] rounded-br-[30px] bg-delilahPrimary pt-4"
					: "left-closed"
			}
		>
			<ModeSelector
				selectedMode={selectedMode}
				setSelectedMode={setSelectedMode}
			/>

			{selectedMode === "chat" ? (
				<>
					<NewThreadButton
						threads={threads}
						setThreads={setThreads}
						selectedThread={selectedThread}
						setSelectedThread={setSelectedThread}
					/>

					<ThreadsTray
						threads={threads}
						setThreads={setThreads}
						selectedThread={selectedThread}
						setSelectedThread={setSelectedThread}
					/>
				</>
			) : (
				<>
					<NewFreewriteThreadButton
						freewriteThreads={freewriteThreads}
						setFreewriteThreads={setFreewriteThreads}
						setSelectedFreewriteThread={setSelectedFreewriteThread}
					/>

					<FreeWriteThreadsTray
						freewriteThreads={freewriteThreads}
						setFreewriteThreads={setFreewriteThreads}
						selectedFreewriteThread={selectedFreewriteThread}
						setSelectedFreewriteThread={setSelectedFreewriteThread}
					/>
				</>
			)}

			<NavTray
				subscribed={subscribed}
				setShowSettings={setShowSettings}
			/>
		</div>
	)
}

export default Left
